import React from 'react';
import spareLines from "../data/spare_lines"
import * as style from "../css/spareLine"

export default function SpareLines() {
  const renderSpareList = () => {
    return spareLines['spare_lines'].map((item, i) => (
      <div key={i} style={style.spareLineItem}>{item}</div>
    ))
  }

  return (
    <div style={{display: "inline-block"}}>
      <div style={style.spareLineIndex}>Spare Lines</div>
      <div style={style.spareLineContainer}>{renderSpareList()}</div>
    </div>
  )
}
